import { Link } from "react-router-dom";
import Header from "../components/Header";
import { useState, useEffect } from 'react';
import Open from '../components/Open';
import DateRangeForm from "../components/DateRangeForm";
import axios from "axios";
import List from "../components/List";

const ChartSpend = (props) => {

    const sessionEmail = localStorage.getItem("email");
    const [cost, setCost] = useState({});
    const sessionStartDate = localStorage.getItem("startDate");
    const sessionEndDate = localStorage.getItem("endDate");
    console.log("session: "+sessionStartDate+"to"+sessionEndDate);

    useEffect(() => {
        const fetchData = async () => {
          try {
            const response = await axios.post('https://www.zoelindev.com/moneyCatBackend/typelist.php', {
              email: sessionEmail,
              startDate: sessionStartDate,
              endDate: sessionEndDate
            });
            setCost(response.data);
          } catch (error) {
            console.error(error);
          }
        };
        fetchData();
      }, [sessionEmail, sessionStartDate, sessionEndDate]);

    return (
        <div className="chartWrap">
            <Header />
            <div className="round3"></div>
            <h2>Monthly</h2>

            <div className="op">
                <Link to="/chart_spend" className="chartSpendBtn">
                    Spend /
                </Link>
                <Link to="/chart_income" className="chartIncomeBtn">
                    Income
                </Link>
            </div>

            <div className="top">
                <DateRangeForm email={sessionEmail} />
            </div>

            <div className="spendDetail">
                <Open title="Food" cost={cost['food']}>

                </Open>
                <Open title="Home" cost={cost['home']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="home" />
                </Open>
                <Open title="Fun" cost={cost['fun']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="fun" />
                </Open>
                <Open title="Travel" cost={cost['travel']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="travel" />
                </Open>
                <Open title="Health" cost={cost['health']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="health" />
                </Open>

                <Open title="Learn" cost={cost['learn']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="learn" />
                </Open>
                <Open title="Shop" cost={cost['shop']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="shop" />
                </Open>
                <Open title="Lend" cost={cost['lend']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="lend" />
                </Open>
                <Open title="Others" cost={cost['others']}>
                    <List email={sessionEmail} startDate={localStorage.getItem("startDate")} endDate={localStorage.getItem("endDate")} type="others" />
                </Open>
            </div>

        </div>
    );
}

export default ChartSpend;
